import React, { useState } from "react";
import reactDom from "react-dom";
import Modal from "react-bootstrap/Modal";
import prevButton from "./assets/button-prev.png";
import nextButton from "./assets/button-next.png";
import Button from "react-bootstrap/Button";


export default function CustomModal(props) {
  const { id, label, prev, next, current } = props;
  const [modalShow, setModalShow] = useState(null);

  label = 'current';

  return (
    <Modal
      label = {label}
      show={modalShow}
      onHide={() => setModalShow(false)}
      {...props}
      size="md"
      aria-labelledby="contained-modal-title-vcenter"
      centered
    >
      <Modal.Header>
        <Modal.Title id="contained-modal-title-vcenter"></Modal.Title>
      </Modal.Header>

      <Modal.Body id={id} >
        <h4></h4>
<div>
       
{(() => {
  
  switch (label) {
     case 'current':
         return (
           <img src = {current} />
         )
     case 'prev':
         return (
           <img src = {prev} />
         )
      case 'next':
          return(
            <img src = {next} />
          )
     default:
         return (
           <img src = {current} />
         )
  }

})()}
</div>
        
      </Modal.Body>
      <Modal.Footer>
      <Button className="prev" onClick={()=> label = 'prev'} >
          <img src = {prevButton} />
        </Button>
        <Button className="next" onClick={()=> label ='next'} >
          <img src = {nextButton} />
        </Button>

      </Modal.Footer>
    </Modal>
  );
}
